        Make3Dig: Make3Dig,
        randomHexColor: randomHexColor,
        randomRGBAGenerator: randomRGBAGenerator,
        colorMixerForTwoStrings: colorMixerForTwoStrings,
        colorMixerForTwoObjects: colorMixerForTwoObjects,
